import './App.css';

function App() {
  return (
    <main>
      <h1>$400<span>.00</span></h1>
      <div className="basic">
        <input type="text" placeholder="+200 new phone" />
        <input type="datetime-local" />
      </div>
      <div className='desc'>
        <input type="text" placeholder="Description" />
      </div>
      <button type="submit" className="btn">Add Transaction</button>
    </main>
  );
}

export default App;
